import React from "react";

import SignatureTable from "./SignatureTable"; // Import the new component

function GeneratedSignature({
  fullName,
  jobTitle,
  phoneNumber,
  emailAddress,
  address,
  employeeImage,
  color,
}) {
  return (
    <div
      className="tableContainer padding-lg radius-lg"
      style={{
        background: "white",
      }}
    >
      <div
        style={{
          width: "fit-content",
          margin: "0 auto",
        }}
      >
        <SignatureTable
          fullName={fullName}
          jobTitle={jobTitle}
          phoneNumber={phoneNumber}
          employeeImage={employeeImage}
          color={color}
        />
      </div>
    </div>
  );
}

export default GeneratedSignature;
